Mongo Aggregation and Filter<p>I am trying to filter documents using the following query:</p>

<pre><code>db.projects.aggregate([
    {
        $project: { 
            deployments: { 
                $filter: { 
                    input: "$releases.deployments", 
                    as: "deployment", 
                    cond: { $eq: ["$$deployment.environment", "Live"] }
                }
            }
        }
    }
])
</code></pre>

<p>The output for <code>deployments</code> is always an empty array although if I change the condition to <code>$ne</code> then it returns all of the results.</p>

<p>How do I get the filter condition to return only records where <code>deployment.environment</code> equals the string <code>Live</code>?</p>

<p>Here is a sample piece of json:</p>

<pre><code>{
      "project_id": "1",
      "project_group": "A",
      "releases": [
        {
          "version": "1",
          "deployments": [
            {
              "environment": "Integration",
              "created": "2019-10-01T06:40:01.000Z",
              "state": "Success",
              "name": "Deploy to Integration"
            },
            {
              "environment": "Test",
              "created": "2019-10-01T08:23:58.000Z",
              "state": "Success",
              "name": "Deploy to Test"
            },
            {
              "environment": "Live",
              "created": "2019-10-01T09:02:17.000Z",
              "state": "Success",
              "name": "Deploy to Live"
            }
          ]
        }
      ]
    }
</code></pre>

