How $min and $max works internally on an embedded document?<p>Let's say, I initially have the following documents in DB:</p>

<pre><code>{
    "_id" : ObjectId("5d932facf2e6411a68a145e8"),
    "name" : "mechanic",
    "value" : {
        "a" : 1,
        "b" : 2
    }
}
{
    "_id" : ObjectId("5d932facf2e6411a68a145e9"),
    "name" : "mechanic",
    "value" : {
        "a" : 2,
        "b" : 1
    }
}
{
    "_id" : ObjectId("5d932facf2e6411a68a145ea"),
    "name" : "mechanic",
    "value" : {
        "a" : 0,
        "b" : 3
    }
}
{
    "_id" : ObjectId("5d9332eff2e6411a68a145ec"),
    "name" : "mechanic",
    "value" : {
        "a" : 0,
        "b" : 2
    }
}
</code></pre>

<p>When I run the following query:</p>

<pre><code>db.collection.aggregate([ { $group:{ "_id":"$name", "min_doc":{ $min:"$value" } } } ]).pretty()
</code></pre>

<p>It returns:</p>

<pre><code>{ "_id" : "mechanic", "min_doc" : { "a" : 0, "b" : 2 } }
</code></pre>

<p>Which seems, its comparing the keys of sub-document <code>value</code> one by one i.e. find minimum 'a', if multiple documents have minimum 'a', then find minimum 'b'.</p>

<p>But then, I add one more document:</p>

<pre><code>{
    "_id" : ObjectId("5d933330f2e6411a68a145ed"),
    "name" : "mechanic",
    "value" : {
        "b" : 1,
        "a" : 0
    }
}
</code></pre>

<p>And it returns the same output. But the last document has the lowest 'a' and 'b'.</p>

<p>How it's working internally?</p>

