Strange problem when storing and querying GeoJson in MongoDB<p>I want to store GeoJson data for an area using MongoDB. The data comes from an official website. Each area is represented as <code>MultiPolygon</code>. In the end, I want to find all areas that contain a lng/lat pairs using a <code>$intersect</code> like that:</p>

<pre><code>db.areas.find({
  "location.geometry": {
    "$geoIntersects": {
         "$geometry": {
            "type": "Point",
            "coordinates": [ 
                &lt;lng&gt;, 
                &lt;lat&gt;
            ]
         }
     }
  }
}
</code></pre>

<p>In principle, it seems to work just fine. However, I've encountered problems with some areas seemingly with respect to the set of polygons of a <code>MultiPolygon</code>. I could boil down my problem to an individual case:</p>

<p>An area (being a GeoJson <code>MultiPolygon</code>) has six polygons, say <code>[A, B, C, D, E, F]</code>. Also the point <code>&lt;lng&gt;,&lt;lat&gt;</code> I query for lies within polygon <code>A</code>. Now the query above only works if the area does not contain the polygons <code>D</code> and <code>F</code> (<code>A</code> has to be included always, of course) -- that is, I get the expected search result. Otherwise, the query is empty (but no error). In short</p>

<ul>
<li>What works: <code>[A]</code>, <code>[A,B]</code>, <code>[A,B,C]</code>, <code>[A,B,C,E]</code>, <code>[A,C]</code>, ... (any combination with <code>A</code> and without <code>D</code> &amp; <code>F</code>)</li>
<li>What doesn't work: <code>[A,D]</code>, <code>[A,B,F]</code>, ... (any combination that contains <code>D</code> or <code>F</code>)</li>
</ul>

<p>What is the problem with polygons <code>D</code> and <code>F</code>? Are they not allowed to overlap with other polygons in the <code>MultiPolygon</code>? Are they maybe too small? I've tried the GeoJson definition but couldn't see any issues. Could it be because the GeoJson support of MongoDB.</p>

